    false,nt"url": null,nt"notes": "This annual narrative report for Eastern
    Massachusetts National Wildlife Refuge Complex outlines Refuge accomplishments during
    the 1993 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. The report includes a planning section which discusses the
    master plan and research and investigations. Refuge administration is outlined;
    information about personnel, volunteer programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    forests, fire management, and wilderness areas. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries
    resources, scientific collections, animal control, and marking and bird banding.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, wildlife observation, and law enforcement. The equipment
    and facilities section of the report provides information about major maintenance.",nt"owner_org":
